// src/App.js
import './CSS/stylesBigDesktop.css'
import './CSS/stylesDesktop.css'
import './CSS/stylesAlmostDesktop.css'
import './stylesLargeTablet.css'
import './stylesMediumTablet.css'
import './stylesTablet.css'
import './stylesMobile.css'
import './stylesSmallMobile.css'
import './index';
import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import Login from './Login';
import Register from './Register';
import Home from './Home'; 
import AdminDashboard from './AdminDashboard';
import Wish from './Wish';
import Series from './Series';
import Movies from './Movies';

function App() {
  return (
    <Router>
      <Routes>
        <Route path="/" element={<Home />} />           {/* Homepage */}
        <Route path="/login" element={<Login />} />     {/* Login page */}
        <Route path="/register" element={<Register />} /> {/* Register page */}
        <Route path="/admin" element={<AdminDashboard />} />{/* Admin page */}
        <Route path="/wish" element={<Wish />} />{/* Admin page */}
        <Route path="/movies" element={<Movies />} />{/* Admin page */}
        <Route path="/series" element={<Series />} />{/* Admin page */}
      </Routes>
    </Router>
  );
}

export default App;
